import React, { useState } from 'react';
import loginIcon from "../assest/signin.gif";
import { Link } from 'react-router-dom';
import imageTobase64 from "../helpers/imagetobase64.js";
import SummeryApi from '../common/index.js';

const Signup = () => {
  const [data,setData] = useState({
    email:"",
    password:"",
    name : "",
    confirmPassword: "",
    profilePic:"",
  });

  const handleOnChange = (e) => {
       const {name,value} = e.target;

       setData((preve)=>{
        return{
         ...preve,
         [name]: value,      
        }
       });
  }

  const handleUploadPic = async(e) => {
      const file = e.target.files[0]
      const imagePic = await imageTobase64(file)
      console.log("imagePic",imagePic)
      setData((preve)=>{
        return{
          ...preve,
          profilePic:imagePic
        }
      })
  }

const handleSubmit = async(e) => {
    e.preventDefault();

    const dataRespose = await fetch(SummeryApi.signUp.url,{
      method : SummeryApi.signUp.method,
      headers : {
        "content-type" : "application/json"
      },
      body : JSON.stringify(data)
    });

    const data = await dataRespose.json();
    console.log
}


  return (
<section id="signup">
      <div className="max-auto container p-4">
        <div className="bg-white p-5 w-full max-w-md mx-auto">
        <div className="w-16 h-16 mx-auto relative overflow-hidden rounded-full">
            <div>
            <img src={data.profilePic || loginIcon} alt="login icon" />
            </div>
            <form>
        <label>
        <div className=' bg-slate-200 pb-2 cursor-pointer pt-2 text-center text-xs absolute bottom-0 w-full bg-opacity-80'>
            Upload photo
            </div>
            <input type='file' className='hidden' onChange={handleUploadPic}/>
        </label>
            </form>
          </div>
          <form className="pt-6 flex flex-col gap-2" onSubmit={handleSubmit}>
          <div className="grid">
              <label>Name : </label>
              <div className="bg-slate-100 p-2">
                <input
                  type="text"
                  placeholder="Enter your Name"
                  name="name"
                  required
                  value={data.name}
                  onChange={handleOnChange}
                  className="w-full h-full outline-none bg-transparent"
                />
              </div>
            </div>
            <div className="grid">
              <label>Email : </label>
              <div className="bg-slate-100 p-2">
                <input
                  type="email"
                  placeholder="Enter your email"
                  name="email"
                  required
                  value={data.email}
                  onChange={handleOnChange}
                  className="w-full h-full outline-none bg-transparent"
                />
              </div>
            </div>
            <div>
              <label>Password : </label>
              <div className="bg-slate-100 p-2 flex">
                <input
                  type="password"
                  placeholder="Enter your Password"
                  name="password"
                  required
                  value={data.password}
                  onChange={handleOnChange}
                  className="w-full h-full outline-none bg-transparent"
                />
              </div>
              <label>Confirm Password : </label>
              <div className="bg-slate-100 p-2 flex">
                <input
                  type="password"
                  placeholder="Confirm Password"
                  name="confirmPassword"
                  required
                  value={data.confirmPassword}
                  onChange={handleOnChange}
                  className="w-full h-full outline-none bg-transparent"
                />
              </div>

            </div>
            <button className="bg-red-600 hover:bg-red-700 text-white px-6 py-2 w-full rounded-full max-w-[150px] hover:scale-110 transition-all mx-auto block mt-4">Sign Up</button>
          </form>
          <p className="my-5">Already have an acoount ?<Link to={"/login"} className="hover:text-red-700 hover:underline"> Login</Link></p>

        </div>
      </div>
    </section>
  )
}

export default Signup;
